import React from 'react'
import './Display.css'
import data_new from '../Assets/data_new'
import Item from '../Item/Item'

const Display = () => {
  return (
    <div className='display'>
        <div className="twoitems">
            {data_new.map((item)=>{
                return <Item image={item.image}/>
            })}
        </div>
      
    </div>
  )
}

export default Display
